t.add("contactus.program-adding-not-feasible.text", "Wir haben bereits gepr\u00fcft, <span class=\"blue-bolder\">%program%<\/span> hinzuzuf\u00fcgen, stellten aber fest, dass dies <b>nicht durchf\u00fchrbar ist<\/b>. Das h\u00e4ufigste Problem daf\u00fcr, einem Programm keinen Support hinzuf\u00fcgen zu k\u00f6nnen, ist, dass es einfach keine Form von Pr\u00e4mienguthaben auf seiner Website anzeigt. Wenn Sie wissen, dass dem nicht so ist, d. h., Sie k\u00f6nnen sich sowohl in die Website einloggen als auch tats\u00e4chlich Ihr Punkteguthaben sehen, teilen Sie uns dies bitte mit.", "contactus", "de");
