t.add("contactus.program-already-marked-broken.text", "<span class=\"blue-bolder\">%program%<\/span> ist <b>in unserem System<\/b> bereits als defekt gekennzeichnet und wir k\u00fcmmern uns darum, es wieder in Gang zu bringen. Es besteht keine Notwendigkeit, wegen dieses Programms mit uns Kontakt aufzunehmen. Wenn Sie davon in Kenntnis gesetzt werden m\u00f6chten, dass es wieder in Gang gebracht wurde, klicken Sie bitte <span class=\"green\">+1<\/span> auf unserer <a href=\"%link%\" target=\"_blank\">Statusseite<\/a> an.", "contactus", "de");
