t.add("welcome.add_loyalty_cards", "Alle Ihre Treuekarten hinzuf\u00fcgen", "email", "de");
t.add("welcome.add_loyalty_cards.desc_v2", "Bei AwardWallet geht es nicht nur um Reisen; wir hoffen zwar, dass Sie AwardWallet verwenden, um Ihre Vielfliegermeilen und Hotelpunkte zu verfolgen, aber wir sind fanatisch in Bezug auf alle Arten von Pr\u00e4mien. Wir decken Retail-Treueprogramme wie Starbucks und Best Buy sowie Pr\u00e4mienprogramme ab, die mit allen gro\u00dfen Banken verbunden sind; insgesamt unterst\u00fctzen wir fast 700 Programme. St\u00f6bern Sie in der %link1_on%Liste unserer unterst\u00fctzten Programme%link1_off%. %status%Besorgt \u00fcber Sicherheit? Wir auch. Wir albern nicht herum, wenn es um unsere Mitglieder und ihre Pr\u00e4mien geht. Hier ist unsere Aussage zur Sicherheit: %link2%. Wir empfehlen Ihnen, auch die Einrichtung von %link3_on%Zwei-Faktor-Authentifizierung%link3_off% f\u00fcr zus\u00e4tzlichen Schutz in Betracht zu ziehen.", "email", "de");
t.add("welcome.blog", "Wir haben einen Blog zu %link1_on%Bereitstellung von Punkte- und Meilen-Inhalt f\u00fcr Sie auf einer t\u00e4glichen Basis %link1_off% erstellt. Wir decken alles ab, von relevanten Nachrichten bis dahin, wie Sie den besten Wert aus Ihren Punkten und Meilen ziehen k\u00f6nnen.", "email", "de");
t.add("welcome.book_reward_tickets.desc_v2", "Sind Sie bereit f\u00fcr eine Reise, haben aber Schwierigkeiten, Ihre hart erarbeiteten Meilen einzul\u00f6sen? Wir haben ein Team, das bereit ist zu helfen! Teilen Sie uns mit, wohin Sie gehen m\u00f6chten, indem Sie eine Buchungsanfrage senden: %link% und wir werden die beste Nutzung Ihrer Punktemeilen finden und Ihre Tickets f\u00fcr Sie buchen.", "email", "de");
t.add("welcome.book_reward_tickets_v2", "Punkte einl\u00f6sen &amp; Meilen", "email", "de");
t.add("welcome.choose_cc.desc_v2", "Wenn Sie es ernst meinen mit dem Sammeln von Meilen und Punkten, m\u00fcssen Sie die %link1_on%besten Pr\u00e4mien-Kreditkarten%link1_off% kennen, die heute auf dem Markt erh\u00e4ltlich sind. Pr\u00e4mienkarten sind ein wichtiger Schl\u00fcssel, um schnell Meilen zu sammeln. Unsere Wahl Nummer 1 %link2_on% ist eine flexible Reisepr\u00e4mien-Kreditkarte%link2_off%, mit der Sie Ihre Pr\u00e4mien wie Bargeld oder f\u00fcr Transfer zu Flug-\/Hotelpartnern einl\u00f6sen k\u00f6nnen.", "email", "de");
t.add("welcome.choose_cc_v2", "W\u00e4hlen Sie die richtige Kreditkarte", "email", "de");
t.add("welcome.facebook", "Wir haben auch eine Facebook Community, %link1_on%Pr\u00e4mienreise 101%link1_off%, mit Zehntausenden von Mitgliedern. Wenn Sie eine Pr\u00e4mienfrage haben, die Sie beantwortet haben m\u00f6chten, ist dies Ihr Ziel!", "email", "de");
t.add("welcome.get_app", "Erhalten Sie die AwardWallet-App", "email", "de");
t.add("welcome.get_app.desc_v2", "Wir haben eine fantastische App f\u00fcr %link1_on%iOS%link1_off% und %link2_on%Android%link2_off% Ger\u00e4te. Wenn Sie bereits ein AwardWallet-Konto haben, h\u00e4lt die Installation unserer App Sie n\u00e4her an Ihren Punkten und Meilen.", "email", "de");
t.add("welcome.organize_trips.desc_v2", "M\u00f6chten Sie einen einzigen Ort, an dem Sie alle Ihre Reisepl\u00e4ne aufbewahren k\u00f6nnen? Wir haben alles im Griff. AwardWallet kann jede Reisekomponente f\u00fcr alle Ihre Reisen von verschiedenen Anbietern \u00fcbernehmen, einschlie\u00dflich Flug, Hotel, Mietwagen und Essen, sie organisieren, alle in eine einzige - einfach zu bedienende Zeitleiste einf\u00fcgen. Sie k\u00f6nnen Ihre Reisen importieren, indem Sie sie von Ihren Treuekonten ziehen: %link% oder Sie k\u00f6nnen sie per E-Mail an Ihr pers\u00f6nliches AwardWallet-Postfach senden: %email%.", "email", "de");
