t.add("answer.1", "AwardWallet.com hat 3 Hauptfunktionen: <ol class=\"counter-list\"> <li>AwardWallet soll Ihnen und Ihrer Familie helfen, verschiedene Treuekonten zu verfolgen. Wir tun dies \u00fcber Login in verschiedene Pr\u00e4mienkonten und Abrufen Ihres Guthabens in Ihrem Namen. Wir rufen Verfall, Elitestatus usw. ab oder berechnen ihn und zeigen diese Informationen in einem einzigen, leicht zu verstehenden Bericht.<\/li> <li>AwardWallet unterst\u00fctzt Sie dabei, Ihre Reisepl\u00e4ne \u00fcber unsere Funktion \"<a href=\"\/trips\/\">Reise<\/a>\" im Web und \u00fcber Ihre mobilen Apps zu verwalten.<\/li> <li>AwardWallet hilft Ihnen, Ihre Meilen f\u00fcr internationale Flugpreise f\u00fcr First oder Business Class einzul\u00f6sen. Schicken Sie <a href=\"\/awardBooking\/add\">einfach eine Buchungsanfrage<\/a> und unser Team findet den besten Reiseplan f\u00fcr Sie.<\/li> <\/ol>", "faq", "de");
t.add("answer.10", "<div class=\"secure-information\"> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-1\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Wir verwenden bei der \u00dcbertragung und beim Empfang von Kundendaten, die auf unserer Website eingegeben wurden, immer <span class=\"red\">Verschl\u00fcsselungstechnologien, die dem Industriestandard entsprechen<\/span>. Wir haben in unseren R\u00e4umlichkeiten ad\u00e4quate Sicherheitsma\u00dfnahmen ergriffen, um die Daten, die wir von Ihnen erhoben haben, vor Verlust, Missbrauch oder Modifizierung zu sch\u00fctzen.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-2\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Wir unterst\u00fctzen unsere Nutzer <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">dabei,<\/a> <span class=\"red\">Zwei-Faktor-Authentifizierung<\/span> auf Ihren Konten zu aktivieren. Sollte wirklich jemand Ihr AwardWallet-Passwort stehlen oder Zugriff auf Ihren Computer erhalten, so muss er dennoch erst einen einmaligen Code erstellen, um in Ihr Profil zu gelangen.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-3\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Alle Ihre <span class=\"red\">sensiblen Daten sind<\/span> in unserer sicheren Datenbank verschl\u00fcsselt. Wann auch immer wir Ihre Passw\u00f6rter \u00fcbertragen, nutzen wir HTTPS, das sichere Hypertext-\u00dcbertragungsprotokoll (ohne Heartbleed). Wir erm\u00f6glichen Ihnen auch, Ihre Passw\u00f6rter in einem Cookie lokal auf Ihrem Computer zu speichern. Doch bietet das Speichern Ihrer Passw\u00f6rter in unserer Datenbank Vorteile. Wir sind dann beispielsweise in der Lage, Ihre Guthaben automatisch f\u00fcr Sie zu \u00fcberwachen und Ihnen bei \u00c4nderungen einen Bericht dar\u00fcber zu senden. Tausende schenken uns in Bezug auf ihre Kontodaten das Vertrauen. Unser Service ist ausgereift (unsere Website ist seit 2004 online), die Website wurde in den USA erstellt und wird auch dort gehostet.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-4\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Wir <span class=\"red\">nehmen an einem Bug-Bounty-Programm<\/span> mit&nbsp;Cobalt&nbsp;<a href=\"https:\/\/cobalt.io\/awardwallet\">https:\/\/cobalt.io\/awardwallet<\/a> teil, in dessen Rahmen wir Hacker bezahlen, Sicherheitsprobleme bei unserem Service ausfindig zu machen.<\/p> <\/div> <\/div> <\/div> &nbsp; <p><strong>Und f\u00fcr die Technikfreaks da drau\u00dfen einige weitere Informationen:<\/strong><\/p> <ul> <li>Ihre Passw\u00f6rter f\u00fcr AwardWallet sind gehasht mit bcrypt, cost:13, plus spezifischer Salt f\u00fcr jeden Nutzer.<\/li> <li>F\u00fcr die Passw\u00f6rter, die Nutzer lokal auf ihren Computern speichern, verwenden wir Rijndael (\u00e4hnlich AES), 256 Bit.<\/li> <li>Das \"remember me\"-Cookie ist ein SHA256-Hashwert\u00a0von bestimmten Nutzer-Attributen<\/li> <li>Treuekonto-Passw\u00f6rter werden mit 1024-RSA Schl\u00fcssel verschl\u00fcsselt.<\/li> <li>Bei Brute-Force-Attacken auf Ihr Konto werden wir den Angreifer nach einigen erfolglosen Log-in-Versuchen eine Zeit lang aussperren.<\/li> <\/ul>", "faq", "de");
t.add("answer.11", "Nach Ihrem Log-in rufen Sie \"<a class=\"a14pxBlue\" href=\"\/account\/list.php\">Meine Pr\u00e4mienprogramme<\/a>\" auf. Auf dieser Seite k\u00f6nnen Sie zu \"<a class=\"a14pxBlue\" href=\"\/account\/add.php\">Neues Programm hinzuf\u00fcgen<\/a>\" im linken Navigationsmen\u00fc navigieren. W\u00e4hlen Sie ein Pr\u00e4mienprogramm aus der Auflistung, damit es Ihrem Profil hinzugef\u00fcgt wird. Bitte beachten Sie, dass Ihnen vor dem Hinzuf\u00fcgen eines Programms Ihr Nutzername und Passwort der Website des Treueprogramms bekannt sein muss, die Ihnen Ihr Guthaben zur Verf\u00fcgung stellt. Wenn Sie sich nicht in die Website einloggen k\u00f6nnen, die das Guthaben zur Verf\u00fcgung stellt (d. h. f\u00fcr Marriott w\u00e4re es <a class=\"a14pxBlue\" href=\"http:\/\/www.marriott.com\">http:\/\/www.marriott.com<\/a>), so ist AwardWallet auch nicht in der Lage, das Guthaben abzurufen. Nachdem Sie Ihrem Profil ein Pr\u00e4mienprogramm hinzugef\u00fcgt haben, wird es unter \"<a class=\"a14pxBlue\" href=\"\/account\/list.php\">GUTHABEN<\/a>\" zu sehen sein. Dort k\u00f6nnen Sie entweder den \"Aktualisieren\"-Button anklicken, um automatisch das Guthaben f\u00fcr nur ein Programm abzurufen oder Sie k\u00f6nnen den \"Alle aktualisieren\"-Button anklicken, um automatisch alle Pr\u00e4mienprogramme in Ihrem Profil zu aktualisieren. Bitte beachten Sie, dass Sie, wenn Ihre Log-in-Daten korrekt sind, auch unsere Funktion f\u00fcr automatischen Log-in nutzen k\u00f6nnen, sodass AwardWallet.com Sie automatisch in die Website des Anbieters (d. h. www.marriott.com) einloggt. Auf diese Weise k\u00f6nnen Sie jede zus\u00e4tzliche Information \u00fcber Ihr Konto sehen. Die Funktion f\u00fcr automatischen Log-in steht f\u00fcr die meisten Pr\u00e4mienprogramme, die wir listen, zur Verf\u00fcgung. Weitere Einzelheiten zum Auto-Login fonden Sie in diesm Hinweis:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/<\/a>", "faq", "de");
