t.add("answer.72", "Leider bietet AwardWallet im Moment keinen telefonischen Support an, so dass es keine Nummer gibt, die Sie anrufen k\u00f6nnen, um mit uns zu sprechen, aber Sie k\u00f6nnen alle Fragen, die Sie haben, \u00fcber unsere <a href=\"https:\/\/awardwallet.com\/contact\">Kontakt-Seite stellen<\/a>, und einer unserer Support-Mitarbeiter wird sich mit Ihnen in Verbindung setzen. Wir beantworten Supportanfragen in der Regel innerhalb von 1 Werktag.", "faq", "de");
