t.add("answer.45", "In der Webschnittstelle, sobald das Laden Ihrer Kontoseite beendet ist, fangen Sie einfach an, den Kontonamen einzugeben, den Sie sehen m\u00f6chten, und er wird angezeigt. Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/<\/a>", "faq", "de");
