t.add("answer.46", "Wenn die betreffende Fluggesellschaft Teil einer Allianz ist, wird neben ihr ein Allianz-Symbol angezeigt. Klicken Sie auf das Symbol, um alle Fluggesellschaften anzuzeigen, die Teil dieser Allianz sind. Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/2-airline-alliance-popup\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/2-airline-alliance-popup\/<\/a>", "faq", "de");
