t.add("answer.47", "Wenn Sie einen gro\u00dfen Monitor haben, wird durch die Erweiterung der Breite Ihres Browsers automatisch eine Spalte \"Zuletzt aktualisiert\" in Ihre Kontenliste aufgenommen. Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/<\/a>", "faq", "de");
t.add("answer.48", "Zuerst sollten Sie Ihre Konten aktualisieren, dann auf das + Zeichen neben dem Programm klicken und zur Registerkarte \"Verlauf\" wechseln. Dort werden alle aktuellen Transaktionsdetails angezeigt. Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/<\/a>", "faq", "de");
t.add("answer.52", "Ja, f\u00fcgen Sie einfach <a href=\"https:\/\/awardwallet.com\/agents\/add\">die Namen Ihrer Familienmitglieder zu Ihrem Profil hinzu<\/a>, und dann k\u00f6nnen Sie einzelnen Familien-Mitgliedsnamen Treuekonten zuordnen Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/<\/a>", "faq", "de");
t.add("answer.53", "Ja, Sie k\u00f6nnen (und sollten) Ihre Passw\u00f6rter sichern,&nbsp;wenn Sie&nbsp;entschieden haben, sie lokal zu speichern. Sie k\u00f6nnen dies tun, indem Sie die Konten ausw\u00e4hlen, die Sie sichern m\u00f6chten, und dann die Option \"Backup Passw\u00f6rter\" aus dem Men\u00fc \"Aktionen\" w\u00e4hlen. &nbsp;Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/<\/a>", "faq", "de");
t.add("answer.56", "Ja, Sie k\u00f6nnen <a href=\"https:\/\/awardwallet.com\/agents\/add-connection\">Ihre Konten verbinden<\/a>, und dann w\u00e4hlen, welche Konten Sie miteinander teilen m\u00f6chten und welche Zugangsebene Sie bereitstellen m\u00f6chten. Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/<\/a>", "faq", "de");
t.add("answer.68", "Zuerst, vielen Dank! Zweitens, ja, wir haben ein <a href=\"\/faqs#28\">Partnerprogramm<\/a>, und alle unsere Logos und Screenshots und Banner werden auf <a href=\"https:\/\/awardwallet.com\/media\/logos\">dieser Seite<\/a> immer sauber organisiert, auf die apropos immer zugegriffen werden kann, wenn Sie einfach auf unser Logo rechtsklicken (Option-Klick). Weitere Informationen finden Sie in diesem Tipp:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/<\/a>", "faq", "de");
t.add("answer.70", "Um eines der Treuekonten aus Ihrem AwardWallet-Profil zu l\u00f6schen, m\u00fcssen Sie lediglich dieses Konto&nbsp;usw\u00e4hlen, indem Sie ein Kontrollk\u00e4stchen daneben anklicken, und dann sehen Sie im Men\u00fc eine Schaltfl\u00e4che mit einem Papierkorb, die beim Anklicken alle ausgew\u00e4hlten Konten l\u00f6scht.<br \/> <br \/>  <img alt=\"\" src=\"https:\/\/awardwallet.com\/images\/uploaded\/fck\/faq\/en\/70-1.png\" style=\"width: 650px; height: 383px;\" \/>", "faq", "de");
t.add("answer.71", "Bitte \u00fcberpr\u00fcfen Sie zun\u00e4chst noch einmal, ob Sie den richtigen Code eingeben. Wenn Sie zu 100% sicher sind, dass der Code korrekt ist, dann k\u00f6nnte es sich um ein Zeitsynchronisationsproblem handeln. Wenn die Zeit auf Ihrem Laptop 13:00&nbsp; Uhr ist und die Zeit auf Ihrem Telefon, auf dem Sie den Code erstellen, 13:03 ist, w\u00fcrde das ein Problem sein. Synchronisieren Sie in <a href=\"https:\/\/www.google.com\/search?q=how+to+sync+clock+on+android\">diesem Fall Ihre&nbsp;Telefonuhr<\/a>und versuchen Sie es nochmals.", "faq", "de");
t.add("question.47", "Ich habe viele Treuekonten in meinem AwardWallet-Profil, gibt es eine M\u00f6glichkeit f\u00fcr mich, schnell zu sehen, wann jedes Konto zuletzt aktualisiert wurde?", "faq", "de");
