t.add("question.53", "Ich beschlie\u00dfe, einige meiner Konto-Passw\u00f6rter lokal auf meinem Computer zu speichern, gibt es eine M\u00f6glichkeit, sie zu sichern und dann die Passw\u00f6rter auf demselben Computer oder auf einem anderen Computer wiederherzustellen?", "faq", "de");
