t.add("question.71", "Ich richte eine Zwei-Faktor-Authentifizierung f\u00fcr mein Konto ein, aber der Code, den es generiert, funktioniert pl\u00f6tzlich nicht mehr? Was soll ich tun?", "faq", "de");
t.add("answer.74", "Balance Watch \u00fcberwacht ein Treuekonto, um Sie zu benachrichtigen, sobald sich Ihr Kontostand \u00e4ndert. Punkte von American Express, Chase, Citi, Marriott und Capital One werden nicht immer sofort gutgeschrieben, wenn Sie sie in Partnerbindungsprogramme \u00fcbertragen.&nbsp;<br \/> <br \/>Wenn Sie Pr\u00e4mienverf\u00fcgbarkeit f\u00fcr einen Flug oder ein Hotel finden, \u00fcbertragen Sie Ihre Punkte und nutzen Sie diesen Service, um sicherzustellen, dass Sie Ihre Reservierung best\u00e4tigen k\u00f6nnen, bevor die Verf\u00fcgbarkeit verschwindet. Nach der Aktivierung \u00fcberpr\u00fcft AwardWallet Ihr Konto h\u00e4ufig und sendet Ihnen eine Desktop-, Mobil- und E-Mail-Benachrichtigung, sobald eine \u00c4nderung festgestellt wird.&nbsp; <br \/> <br \/> Hier ist ein kurzes Erkl\u00e4rvideo, das unsere Freunde von TripAstute aufgenommen haben:<br \/> &nbsp; <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/329111256\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "de");
t.add("question.74", "Was sind Balance Watch-Gutschriften?", "faq", "de");
t.add("answer.75", "Mit dem AwardWallet <a href=\"https:\/\/awardwallet.com\/merchants\">Merchant Lookup Tool<\/a> k\u00f6nnen Benutzer nach H\u00e4ndlern suchen und feststellen, wie Transaktionen mit diesen H\u00e4ndlern f\u00fcr eine Kreditkartentransaktion codiert werden. Dies ist wichtig, um mit einer bestimmten Kreditkarte m\u00f6glichst viele Punkte zu sammeln.<br \/><br \/>Einige der h\u00e4ufigsten Bonuskategorien f\u00fcr Kreditkartenausgaben sind Lebensmittel, Benzin, Reisen und Essen. Allerdings sind nicht alle H\u00e4ndlertypen so einfach zu klassifizieren. Suchen Sie dazu einfach im Merchant Lookup Tool nach dem betreffenden Gesch\u00e4ft. Daraufhin&nbsp;wird eine Liste der best\u00e4tigten Kreditkarten angezeigt, die bei diesem bestimmten H\u00e4ndler mehr als 1 Punkt pro Dollar verdienen.<br \/> <br \/> Hier ist ein kurzes Erkl\u00e4rvideo:<br \/> <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/360577226\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "de");
t.add("question.75", "Was ist das AwardWallet Merchant Lookup Tool?", "faq", "de");
t.add("answer.76", "AwardWallet verwendet Ihre Google Mail-Daten nur zum Abrufen von Reisereservierungen und Kontoausz\u00fcgen, um den Service von AwardWallet funktionsf\u00e4hig zu machen. Die Verwendung der von AwardWallet erhaltenen Informationen von Google APIs und die \u00dcbertragung von Informationen durch AwardWallet an eine andere App entsprechen den eingeschr\u00e4nkten Nutzungsanforderungen von Google. Dar\u00fcber hinaus werden keine Ihrer pers\u00f6nlichen Daten, die Sie in AwardWallet gespeichert haben, ohne Ihre vorherige ausdr\u00fcckliche schriftliche Zustimmung an Dritte weitergegeben.", "faq", "de");
t.add("question.76", "Wie verwendet AwardWallet die Daten in meinem Postfach, wenn ich mein Google-Postfach mit AwardWallet verkn\u00fcpfe?", "faq", "de");
