t.add("pay-subscription.product.description.long", "%p_on%AwardWallet Plus ist ein Abo-Service mit einer Bezugsdauer von 1 Jahr. Wenn Sie sich anmelden, wird er jedes Jahr automatisch verl\u00e4ngert. Die Kosten f\u00fcr das Abonnement betragen 30 USD pro Jahr ohne Fr\u00fchf\u00f6rdererrabatt und 10 USD pro Jahr mit Fr\u00fchf\u00f6rdererrabatt. Mit AwardWallet Plus erhalten Sie die folgenden weiteren Funktionen:%p_off%%list_on% %item_on%Anzeige weiterer Eigenschaften des Pr\u00e4mienkontos%item_off%%item_on%Anzeige aller Ablaufdaten Ihres Treuekontos, f\u00fcr die der Ablauf bekannt ist%item_off%%item_on%Wenn Sie alle Ihre Konten aktualisieren, werden Sie parallel und bis zu 5 x schneller aktualisiert%item_off%%item_on%Umfassendere \u00dcberwachung und Verfolgung Ihrer Fl\u00fcge%item_off% %list_off%%p_on%AwardWallet Plus-Abonnements, die von der App gekauft werden, werden auf Ihr %store_name%-Konto geladen und innerhalb von 24 Stunden vor dem Ablauf der aktuellen Bezugsfrist automatisch verl\u00e4ngert, au\u00dfer die automatische Verl\u00e4ngerung wurde vorher deaktiviert. Zur Verwaltung Ihrer Anmeldungen oder zur Deaktivierung der automatischen Verl\u00e4ngerung gehen Sie zu den Einstellungen Ihres %store_name%-Kontos. Wenn der Beitrag f\u00fcr die j\u00e4hrliche Anmeldung berechnet wurde, ist keine R\u00fcckerstattung m\u00f6glich. Nach dem Kauf eines Abos verfallen ungenutzte Anteile einer kostenlosen Testperiode.%p_off%%p_on%Weitere Einzelheiten finden Sie in unseren %link_1%Nutzungsbedingungen%link_off% und unserer %link_2%Datenschutzrichtlinie%link_off%.%p_off%", "mobile", "de");
