t.add("accessing_your_data.1", "Unsere Kunden k\u00f6nnen pers\u00f6nliche Informationen jederzeit in ihrem Konto \u00fcberpr\u00fcfen, aktualisieren oder \u00e4ndern. AwardWallet wird Ihnen auf Anfrage auch Informationen dar\u00fcber zur Verf\u00fcgung stellen, ob wir Ihre personenbezogenen Daten speichern oder im Auftrag eines Dritten verarbeiten. Bitte %link_on%kontaktieren Sie uns hier%link_off%, wenn Sie Hilfe bei der \u00dcberpr\u00fcfung Ihrer Informationen ben\u00f6tigen. AwardWallet wird auf Ihre Zugangsanfrage zur \u00dcberpr\u00fcfung der Informationen, die wir f\u00fcr Sie gespeichert haben, innerhalb einer angemessenen Frist antworten.", "privacy", "de");
t.add("accessing_your_data.2", "Wenn Sie aus dem EWR stammen, sind \"personenbezogene Daten\" alle personenbezogenen Daten oder andere erfasste Daten, die Sie direkt oder indirekt identifizieren k\u00f6nnten. M\u00f6glicherweise haben Sie zus\u00e4tzliche Rechte gem\u00e4\u00df ihren Datenschutzgesetzen, wie zum Beispiel die folgenden:", "privacy", "de");
t.add("accessing_your_data.2.1", "Zugang: Recht, den Zugang zu Ihren pers\u00f6nlichen Daten anzufordern sowie eine Kopie dieser pers\u00f6nlichen Daten;", "privacy", "de");
t.add("accessing_your_data.2.2", "Einschr\u00e4nkung: Sie k\u00f6nnen uns bitten, die Verarbeitung Ihrer pers\u00f6nlichen Daten unter bestimmten Umst\u00e4nden einzuschr\u00e4nken;", "privacy", "de");
t.add("accessing_your_data.2.3", "Berichtigung: Sie k\u00f6nnen Ungenauigkeiten in Ihren pers\u00f6nlichen Daten korrigieren lassen;", "privacy", "de");
t.add("accessing_your_data.2.4", "L\u00f6schung: Sie k\u00f6nnen uns unter bestimmten Umst\u00e4nden auffordern, Ihre personenbezogenen Daten zu l\u00f6schen (z. B. wenn die Daten f\u00fcr die Zwecke, f\u00fcr die sie erhoben wurden, nicht mehr erforderlich sind);", "privacy", "de");
t.add("accessing_your_data.2.5", "Widerspruch: Sie k\u00f6nnen der weiteren Verarbeitung Ihrer personenbezogenen Daten unter bestimmten Umst\u00e4nden widersprechen;", "privacy", "de");
t.add("accessing_your_data.2.6", "Widerruf der Einwilligung: Wenn wir uns auf Ihre Einwilligung zur Verarbeitung Ihrer personenbezogenen Daten verlassen, haben Sie das Recht, die Einwilligung abzulehnen und\/oder, falls vorhanden, jederzeit zu widerrufen. Dies hat keinen Einfluss auf die Rechtm\u00e4\u00dfigkeit der Verarbeitung vor dem Widerruf Ihrer Einwilligung.", "privacy", "de");
t.add("accessing_your_data.2.7", "\u00dcbertragbarkeit: Sie k\u00f6nnen uns unter bestimmten Umst\u00e4nden auffordern, Ihre personenbezogenen Daten in einem strukturierten, allgemein verwendeten und maschinenlesbaren Format bereitzustellen.", "privacy", "de");
t.add("accessing_your_data.3", "Sie k\u00f6nnen die oben genannten Rechte aus\u00fcben, indem Sie %link_on%uns kontaktieren%link_off% und wir werden solche Anfragen in \u00dcbereinstimmung mit den geltenden Datenschutzgesetzen pr\u00fcfen. Wir k\u00f6nnen Sie bitten, Ihre Identit\u00e4t zu \u00fcberpr\u00fcfen, bevor wir auf Ihre Anfrage antworten.", "privacy", "de");
t.add("accessing_your_data.4", "Sie haben auch das Recht, jederzeit Fragen oder Beschwerden an Ihre Datenschutzbeh\u00f6rde zu richten.", "privacy", "de");
t.add("accessing_your_data.5", "Wir k\u00f6nnen personenbezogene Daten an Unternehmen weitergeben, die uns bei der Erbringung unserer Dienstleistungen unterst\u00fctzen, und wenn wir dies tun, werden diese \u00dcbertragungen an nachfolgende Dritte durch entsprechende \u00dcbertragungsvereinbarungen abgedeckt. Wir speichern personenbezogene Daten, die wir im Auftrag unseres Kunden verarbeiten, soweit dies zur Erbringung von Dienstleistungen f\u00fcr unseren Kunden erforderlich ist. Au\u00dferdem werden wir diese personenbezogenen Daten nach Bedarf aufbewahren, um unseren gesetzlichen Verpflichtungen nachzukommen, Streitigkeiten beizulegen und unsere Vereinbarungen durchzusetzen.", "privacy", "de");
t.add("accessing_your_data.6", "AwardWallet hat seinen Hauptsitz in den Vereinigten Staaten von Amerika. Informationen, die wir sammeln und pflegen, k\u00f6nnen in die USA und\/oder in andere L\u00e4nder auf der ganzen Welt \u00fcbertragen oder dort kontrolliert und verarbeitet werden. Wenn Sie uns Informationen zur Verf\u00fcgung stellen oder unsere Website(s) und Dienste nutzen, stimmen Sie dieser \u00dcbertragung zu. Wir werden die Privatsph\u00e4re und Sicherheit der von uns erfassten personenbezogenen Daten in \u00dcbereinstimmung mit dieser Datenschutzrichtlinie sch\u00fctzen, unabh\u00e4ngig davon, wo sie verarbeitet oder gespeichert werden.", "privacy", "de");
t.add("accessing_your_data.header", "Zugriff auf Ihre Daten", "privacy", "de");
t.add("california_privacy_rights.header", "Kalifornisches Verbraucherschutzgesetz", "privacy", "de");
t.add("california_privacy_rights.link", "Klicken Sie hier, um zus\u00e4tzliche Angaben zu lesen, die gem\u00e4\u00df dem kalifornischen Verbraucherschutzgesetz erforderlich sind.", "privacy", "de");
t.add("communicating.1", "AwardWallet muss m\u00f6glicherweise aus verschiedenen Gr\u00fcnden mit Ihnen kommunizieren, einschlie\u00dflich:", "privacy", "de");
t.add("communicating.1.1", "Beantwortung Ihrer Fragen und Anfragen. Wenn Sie uns mit einem Problem oder einer Frage kontaktieren, werden wir Ihre Informationen verwenden, um zu antworten.", "privacy", "de");
t.add("communicating.1.2", "Senden von Service- und Verwaltungs-E-Mails sowie Nachrichten an Sie. Wir k\u00f6nnen Sie kontaktieren, um Sie \u00fcber \u00c4nderungen unserer Dienste, unserer Serviceangebote und wichtige servicebezogene Hinweise, wie z. B. Sicherheits- und Betrugshinweise, zu informieren. Diese E-Mails und Nachrichten werden als notwendiger Bestandteil der Dienste angesehen und Sie k\u00f6nnen sie nicht abbestellen.", "privacy", "de");
t.add("communicating.1.3", "Senden von E-Mails \u00fcber neue Produkte oder andere Neuigkeiten \u00fcber AwardWallet, von denen wir glauben, dass Sie sie entweder von uns oder von unseren Gesch\u00e4ftspartnern h\u00f6ren m\u00f6chten. Sie k\u00f6nnen diese Art von Nachrichten jederzeit abbestellen, indem Sie auf den Link zum Abbestellen am Ende jeder Mitteilung klicken.", "privacy", "de");
t.add("communicating.1.4", "Angebot von Empfehlungsprogrammen und Anreizen, die es Ihnen erlauben, E-Mail-, Text- oder URL-Links zu verwenden, die Sie mit Freunden oder Kollegen teilen k\u00f6nnen.", "privacy", "de");
t.add("communicating.header", "Kommunikation", "privacy", "de");
t.add("contents.header", "Inhalte:", "privacy", "de");
t.add("data_collection_info.1", "Wir erfassen verschiedene Arten von Informationen, um Ihnen Dienstleistungen bereitzustellen, einschlie\u00dflich folgende:", "privacy", "de");
t.add("data_collection_info.10", "Wenn wir Sie um die Angabe personenbezogener Daten bitten, um einer gesetzlichen Verpflichtung nachzukommen oder Ihnen Dienstleistungen zu erbringen, werden wir dies zu gegebener Zeit klarstellen und Sie dar\u00fcber informieren, ob die Angabe Ihrer personenbezogenen Daten obligatorisch ist oder nicht (sowie \u00fcber die m\u00f6glichen Folgen, wenn Sie Ihre personenbezogenen Daten nicht angeben).", "privacy", "de");
t.add("data_collection_info.11", "Wenn wir Ihre personenbezogenen Daten im Vertrauen auf unsere berechtigten Interessen oder die eines Dritten erheben und verwenden und diese Interessen oben nicht bereits aufgef\u00fchrt sind, werden wir Ihnen zu gegebener Zeit mitteilen, was diese berechtigten Interessen sind.", "privacy", "de");
t.add("data_collection_info.12", "Wenn Sie Fragen haben oder weitere Informationen \u00fcber die Rechtsgrundlage ben\u00f6tigen, auf der wir Ihre pers\u00f6nlichen Daten sammeln und verwenden, %link_on%kontaktieren Sie uns%link_off% bitte.", "privacy", "de");
t.add("data_collection_info.2", "%bold_on%Kundenkonto- und Registrierungsdaten:%bold_off% Dies umfasst Informationen, die Sie zur Erstellung Ihres Kontos bei uns angeben, und kann Vor- und Nachnamen, Informationen zum Treuepr\u00e4mienprogramm von Drittanbietern (einschlie\u00dflich Kontozugriffsinformationen), Reisereservierungsinformationen, ein Passwort und eine g\u00fcltige E-Mail-Adresse enthalten.", "privacy", "de");
t.add("data_collection_info.3", "Servicedaten (einschlie\u00dflich Sitzungs- und Nutzungsdaten):", "privacy", "de");
t.add("data_collection_info.4", "Wenn Sie unsere Dienste nutzen, erhalten wir Informationen, die durch die Nutzung des Dienstes oder von der Dienstinfrastruktur selbst generiert werden (z. B. Sitzungsdauer, Verbindungsinformationen usw.). Wir k\u00f6nnen auch Nutzungs- und Protokolldaten dar\u00fcber sammeln, wie auf die Dienste zugegriffen und diese verwendet werden, einschlie\u00dflich Informationen \u00fcber das Ger\u00e4t, auf dem Sie die Dienste verwenden, IP-Adressen, Standortinformationen, Spracheinstellungen, welches Betriebssystem Sie verwenden, eindeutige Ger\u00e4tekennungen und andere Diagnosedaten, die uns bei der Unterst\u00fctzung der Dienste helfen. Weitere Informationen zu Servicedaten finden Sie in Abschnitt 3 \"Analysen, Cookies und andere Website-Technologien\".", "privacy", "de");
t.add("data_collection_info.5", "%bold_on%Daten von Drittanbietern:%bold_off% Wir k\u00f6nnen Informationen \u00fcber Sie aus anderen Quellen erhalten, einschlie\u00dflich Belohnungs- oder Treueprogrammen von Drittanbietern (auf die Sie uns Zugriff gew\u00e4hrt haben), \u00f6ffentlich zug\u00e4nglichen Datenbanken oder Dritten, von denen wir Daten gekauft haben, und diese Daten mit Informationen kombinieren, die wir bereits \u00fcber Sie haben. Wir k\u00f6nnen auch Informationen von anderen verbundenen Unternehmen erhalten, die Teil unserer Unternehmensgruppe sind. Dies hilft uns, unsere Aufzeichnungen zu aktualisieren, zu erweitern und zu analysieren, neue Marketingm\u00f6glichkeiten zu identifizieren und Produkte und Dienstleistungen bereitzustellen, die f\u00fcr Sie von Interesse sein k\u00f6nnten.", "privacy", "de");
t.add("data_collection_info.6", "%bold_on%Standortinformationen:%bold_off% Wir erfassen Ihre standortbezogenen Informationen und Ihre IP-Adresse zum Zwecke der Bereitstellung und Unterst\u00fctzung des Dienstes sowie zur Betrugspr\u00e4vention und Sicherheits\u00fcberwachung.", "privacy", "de");
t.add("data_collection_info.7", "%bold_on%Ger\u00e4teinformationen:%bold_off% Wenn Sie unsere Dienste nutzen, erfassen wir automatisch Informationen \u00fcber den von Ihnen verwendeten Ger\u00e4tetyp, die Betriebssystemversion und die eindeutige Ger\u00e4tekennung (oder \"UDID\").", "privacy", "de");
t.add("data_collection_info.8", "%bold_on%Rechtsgrundlage f\u00fcr die Verarbeitung (nur f\u00fcr Personen des EWR):%bold_off% Wenn Sie aus dem EWR stammen, h\u00e4ngt unsere Rechtsgrundlage f\u00fcr die Erfassung und Verwendung der oben beschriebenen personenbezogenen Daten von den betreffenden personenbezogenen Daten und dem spezifischen Kontext ab, in dem wir sie erfassen. Wenn Sie aus dem EWR stammen, sind \"personenbezogene Daten\" alle personenbezogenen Daten oder andere erfasste Daten, die Sie direkt oder indirekt identifizieren k\u00f6nnten.", "privacy", "de");
t.add("data_collection_info.9", "Normalerweise erfassen wir jedoch personenbezogene Daten von Ihnen, wenn wir Ihre Einwilligung dazu haben, wenn wir die personenbezogenen Daten zur Erbringung von Dienstleistungen ben\u00f6tigen oder wenn die Verarbeitung in unserem berechtigten Interesse liegt und nicht durch Ihre Datenschutzinteressen oder Grundrechte und -freiheiten au\u00dfer Kraft gesetzt wird. In einigen F\u00e4llen sind wir m\u00f6glicherweise auch gesetzlich verpflichtet, die betreffenden personenbezogenen Daten zu erheben.", "privacy", "de");
t.add("data_collection_info.header", "Informationen, die wir sammeln und erhalten", "privacy", "de");
t.add("info_sharing.1", "Die Gew\u00e4hrleistung Ihrer Privatsph\u00e4re ist uns wichtig, wir nehmen unsere Verantwortung zum Schutz Ihrer pers\u00f6nlichen Daten sehr ernst. Soweit zul\u00e4ssig, k\u00f6nnen wir bestimmte Informationen und aggregierte Forschungsdaten an Dritte weitergeben, wie in dieser Datenschutzrichtlinie beschrieben. Zu diesen Dritten geh\u00f6ren die folgenden:", "privacy", "de");
t.add("info_sharing.2", "%bold_on%Drittanbieter und Anbieter von Dienstleistungen:%bold_off% Wir verwenden Dienste von Drittanbietern, die uns bei der Durchf\u00fchrung unseres t\u00e4glichen Gesch\u00e4ftsbetriebs helfen. Hier sind einige Beispiele f\u00fcr solche Vorg\u00e4nge:", "privacy", "de");
t.add("info_sharing.2.1", "Hosting und Bereitstellung von AwardWallet-Diensten", "privacy", "de");
t.add("info_sharing.2.2", "Bereitstellung von Kundensupport", "privacy", "de");
t.add("info_sharing.2.3", "Bereitstellung von E-Mail-Kommunikation", "privacy", "de");
t.add("info_sharing.2.4", "Durchf\u00fchrung von Datenspeicherung, Datenanalyse und Wartung", "privacy", "de");
t.add("info_sharing.2.5", "Bereitstellung von Cloud-Computing-Infrastruktur", "privacy", "de");
t.add("info_sharing.3", "Solche Drittanbieter haben nur dann Zugriff auf personenbezogene Daten, wenn dies zur Erf\u00fcllung ihrer Aufgaben erforderlich ist, und sie m\u00fcssen die personenbezogenen Daten in \u00dcbereinstimmung mit dieser Datenschutzrichtlinie verarbeiten. Wenn wir Ihre personenbezogenen Daten an einen Dritten weitergeben, der als Vertreter fungiert, sind wir f\u00fcr alle Handlungen dieser Drittvertreter verantwortlich, die mit dieser Datenschutzrichtlinie unvereinbar sind, sofern gesetzlich nichts anderes bestimmt ist.", "privacy", "de");
t.add("info_sharing.4", "%bold_on%Marketing- und Analysepartner: %bold_off% Wir verwenden bestimmte Marketing- und Analysepartner wie Google Analytics, Facebook Analytics, Sparkpost usw., die uns bei der Vermarktung unserer Produkte helfen und uns verstehen helfen, wie unsere Nutzer unsere Dienste nutzen. So k\u00f6nnen wir unsere Dienste verbessern. Solche Drittpartner k\u00f6nnen Informationen \u00fcber Ihre Nutzung unserer Dienste und m\u00f6glicherweise Informationen \u00fcber Ihre Besuche bei anderen Online-Diensten erhalten. Diese Drittanbieter sind nur berechtigt, Ihre Daten zu verwenden, um ihre Dienste f\u00fcr uns bereitzustellen.", "privacy", "de");
t.add("info_sharing.5", "%bold_on%Werbepartner:%bold_off% Wir arbeiten mit Werbepartnern zusammen, damit wir die Werbeinhalte, die Sie auf unseren Diensten erhalten, anpassen k\u00f6nnen. Weitere Informationen zu diesem Thema finden Sie in Abschnitt 3 \"Tracking-Technologien\".", "privacy", "de");
t.add("info_sharing.6", "%bold_on%Preisgeldb\u00f6rse Forschung:%bold_off% Wir k\u00f6nnen anonymisierte und anonymisierte Daten (die keine personenbezogenen Daten enthalten) an Dritte weitergeben. Beispielsweise f\u00fchren wir Recherchen mit aggregierten Daten durch, die von unseren Nutzern gesammelt wurden, um bestimmte Branchenberichte zu erstellen, zu verwenden und weiterzugeben, z. B. zur Analyse des Wohlbefindens eines Treueprogramms oder zur Gesamtanalyse von Reisetrends. Die aggregierten Daten identifizieren Sie nicht pers\u00f6nlich und werden im Rahmen dieser Datenschutzrichtlinie nicht als personenbezogene Daten behandelt. Wir k\u00f6nnen Ihre pers\u00f6nlichen Daten auch an Dritte weitergeben, jedoch nur mit Ihrer vorherigen Zustimmung. Die Verwendung von Informationen, die AwardWallet von Google-APIs oder Verizon Media-OAuth-APIs erh\u00e4lt, entspricht der %link_on%Google API Services-Benutzerdatenrichtlinie%link_off%, einschlie\u00dflich der Anforderungen f\u00fcr die eingeschr\u00e4nkte Nutzung bzw. der Anforderungen f\u00fcr die eingeschr\u00e4nkte Nutzung von Verizon Media.", "privacy", "de");
t.add("info_sharing.7", "%bold_on%Einhaltung gesetzlicher Vorschriften:%bold_off% In bestimmten F\u00e4llen kann AwardWallet gesetzlich verpflichtet sein, personenbezogene Daten offenzulegen. Beispielsweise k\u00f6nnen wir Ihre Daten offenlegen, um einer g\u00fcltigen Vorladung oder einem anderen rechtlichen Verfahren nachzukommen, wenn wir in gutem Glauben der Ansicht sind, dass die Offenlegung notwendig ist, um unsere Rechte oder Ihre Sicherheit (oder die Sicherheit anderer) zu sch\u00fctzen, um Betrug zu untersuchen; um auf eine Regierungsanfrage zu antworten oder um Anfragen der nationalen Sicherheit oder der Strafverfolgung nachzukommen. Wir k\u00f6nnen Ihre Daten auch im Rahmen einer Fusion, eines Verkaufs von Unternehmensverm\u00f6gen, einer Finanzierung oder des Erwerbs unseres gesamten oder eines Teils unseres Gesch\u00e4fts durch ein anderes Unternehmen an Dritte weitergeben, wobei Kundeninformationen zu den \u00fcbertragenen Verm\u00f6genswerten geh\u00f6ren.", "privacy", "de");
t.add("info_sharing.header", "Informationsaustausch", "privacy", "de");
t.add("info_usage_policy.1", "AwardWallet kann auf die von uns gesammelten Daten zugreifen (was mit Ihrer Zustimmung eine eingeschr\u00e4nkte Anzeige oder Wiedergabe beinhalten kann) und diese nach Bedarf verwenden, (a) um die Dienste bereitzustellen und zu warten, (b) um Service-, Sicherheits- und Kundensupportprobleme anzugehen und darauf zu reagieren, (c) um Betrug, Sicherheit, rechtswidrige oder technische Probleme zu erkennen, zu verhindern oder anderweitig anzugehen, (d) wie gesetzlich vorgeschrieben, (e) um unsere Vertr\u00e4ge zu erf\u00fcllen, (f) um die Dienste zu verbessern und zu verbessern, (g) um unseren Kunden und Nutzern Analysen oder wertvolle Informationen zur Verf\u00fcgung zu stellen.", "privacy", "de");
t.add("info_usage_policy.2", "Einige konkrete Beispiele daf\u00fcr, wie wir die Informationen verwenden:", "privacy", "de");
