t.add("info_usage_policy.3", "AwardWallet speichert Ihre Daten, solange Ihr Konto bei uns aktiv ist, um unseren gesetzlichen Verpflichtungen nachzukommen, Streitigkeiten beizulegen und unsere Vereinbarungen durchzusetzen.", "privacy", "de");
t.add("info_usage_policy.4", "Wenn Sie Ihr Konto k\u00fcndigen oder die Bereitstellung von Diensten f\u00fcr Sie einstellen m\u00f6chten oder wenn wir personenbezogene Daten \u00fcber Sie speichern und Sie m\u00f6chten, dass diese aus unserer Datenbank entfernt oder inaktiviert werden, k\u00f6nnen Sie dies %link_on%hier%link_off% tun.", "privacy", "de");
