t.add("intro.contact_info", "Wenn Sie Fragen zu dieser Datenschutzrichtlinie oder unseren Praktiken haben, %link_on%kontaktieren Sie uns%link_off% bitte. Wenn Sie aus dem Europ\u00e4ischen Wirtschaftsraum (\"EWR\") stammen und ein ungel\u00f6stes Datenschutz- oder Datennutzungsproblem haben, das wir nicht zufriedenstellend gel\u00f6st haben, wenden Sie sich bitte (kostenlos) an unseren in den USA ans\u00e4ssigen Drittanbieter f\u00fcr Streitbeilegung unter %link2_on%http:\/\/go.adr.org\/privacyshield.html%link2_off%.", "privacy", "de");
t.add("intro.header", "Einleitung", "privacy", "de");
t.add("intro.pp_info", "Diese Datenschutzrichtlinie hilft Ihnen zu verstehen, welche Informationen wir bei AwardWallet sammeln und verwenden und welche Auswahlm\u00f6glichkeiten Sie in Zusammenhang mit diesen Informationen haben. Wenn wir in dieser Richtlinie von \"AwardWallet\", \"wir\", \"unser\" oder \"uns\" sprechen, beziehen wir uns auf AwardWallet, LLC, die Ihnen die Dienste zur Verf\u00fcgung stellt. Die \"Dienste\" beziehen sich auf die von AwardWallet bereitgestellten Anwendungen, Dienste und Websites (Marketing und Produkt). AwardWallet kann von Zeit zu Zeit neue Produkte und Dienstleistungen einf\u00fchren. In dem Ma\u00dfe, in dem diese neuen Produkte und Dienstleistungen diese Richtlinie beeinflussen, werden wir Sie wie in Abschnitt 10 unten beschrieben benachrichtigen. Die Verwendung der \u00fcber unseren Service gesammelten Informationen beschr\u00e4nkt sich auf den Zweck der Bereitstellung der Services f\u00fcr unsere Kunden und wie hierin angegeben.", "privacy", "de");
t.add("other_questions", "Wenn Sie weitere Fragen zu dieser Datenschutzrichtlinie haben, %link_on%kontaktieren Sie uns%link_off% bitte.", "privacy", "de");
t.add("privacy_shield_compliance.1", "AwardWallet h\u00e4lt sich an den Rahmen des EU-US-Datenschutzschilds und des Schweiz-US-Datenschutzschilds, wie vom US-Handelsministerium in Bezug auf die Erfassung, Verwendung und Aufbewahrung von personenbezogenen Daten, die aus der Europ\u00e4ischen Union und der Schweiz in die USA \u00fcbertragen werden, festgelegt. AwardWallet hat dem Handelsministerium bescheinigt, dass es die Grunds\u00e4tze des Datenschutzschilds einh\u00e4lt. Bei Widerspr\u00fcchen zwischen den Bestimmungen dieser Datenschutzrichtlinie und den Grunds\u00e4tzen des Datenschutzschilds gelten die Grunds\u00e4tze des Datenschutzschilds. Um mehr \u00fcber das Datenschutzschild-Programm zu erfahren und unsere Zertifizierung einzusehen, besuchen Sie bitte %link_on%https:\/\/www.privacyshield.gov\/%link_off%.", "privacy", "de");
t.add("privacy_shield_compliance.header", "Einhaltung des Datenschutzschilds", "privacy", "de");
t.add("question_complaint.1", "In \u00dcbereinstimmung mit den Grunds\u00e4tzen des Datenschutzschilds verpflichtet sich AwardWallet, Beschwerden \u00fcber unsere Erfassung oder Verwendung Ihrer pers\u00f6nlichen Daten beizulegen. Personen aus der EU und der Schweiz, die Anfragen oder Beschwerden zu unserer Datenschutzrichtlinie haben, sollten sich zuerst %link_on%hier an AwardWallet%link_off% wenden.", "privacy", "de");
t.add("question_complaint.2", "AwardWallet hat sich ferner verpflichtet, ungel\u00f6ste Datenschutzschild-Beschwerden an die %link_on%American Arbitration Association%link_off% weiterzuleiten, einen Anbieter f\u00fcr alternative Streitbeilegung mit Sitz in den USA. Wenn Sie von uns keine rechtzeitige Best\u00e4tigung Ihrer Beschwerde erhalten oder wenn wir Ihre Beschwerde nicht zu Ihrer Zufriedenheit bearbeitet haben, wenden Sie sich bitte an oder besuchen Sie %link2_on%https:\/\/go.adr.org\/privacyshield.html%link2_off%, um weitere Informationen zu erhalten oder eine Beschwerde einzureichen. Die Dienstleistungen der American Arbitration Association werden Ihnen kostenlos zur Verf\u00fcgung gestellt.", "privacy", "de");
t.add("question_complaint.3", "Sie k\u00f6nnen sich unter bestimmten Umst\u00e4nden auf ein verbindliches Schiedsverfahren f\u00fcr Beschwerden berufen, die nicht durch die oben genannten Mechanismen gel\u00f6st wurden. Weitere Informationen finden Sie unter %link_on%https:\/\/www.privacyshield.gov\/article?id=ANNEX-I-introduction%link_off%.", "privacy", "de");
t.add("question_complaint.4", "AwardWallet unterliegt den Untersuchungs\u2013 und Durchsetzungsbefugnissen der US-Bundeshandelskommission in Bezug auf die Einhaltung des Rahmens des EU-US-Datenschutzschilds und des Schweiz-US-Datenschutzschilds.", "privacy", "de");
t.add("question_complaint.header", "Fragen oder Beschwerden", "privacy", "de");
t.add("security.1", "AwardWallet befolgt allgemein anerkannte Standards zum Schutz der an uns \u00fcbermittelten personenbezogenen Daten, sowohl w\u00e4hrend der \u00dcbertragung als auch nach Erhalt. Jedoch ist keine Sicherheitsma\u00dfnahme perfekt. Wir empfehlen, Ihr Passwort zu sch\u00fctzen und %link_on%die Zwei-Faktor-Authentifizierung f\u00fcr Ihr Konto%link_off%zu implementieren, da dies eine der einfachsten M\u00f6glichkeiten ist, die Sicherheit Ihres eigenen Kontos zu verwalten. Denken Sie daran, dass Sie die Kontrolle \u00fcber Ihre pers\u00f6nlichen Daten verlieren k\u00f6nnen, wenn Sie die Kontrolle \u00fcber Ihr Passwort verlieren.", "privacy", "de");
t.add("security.header", "Sicherheit", "privacy", "de");
t.add("statement_changes.1", "Wir k\u00f6nnen diese Datenschutzrichtlinie aktualisieren, um \u00c4nderungen an unseren Informationspraktiken zu ber\u00fccksichtigen. Wenn wir wesentliche \u00c4nderungen vornehmen, werden wir Sie auf dieser Webseite dar\u00fcber informieren und wir k\u00f6nnen Sie per E-Mail (an die in Ihrem Konto angegebene E-Mail-Adresse) benachrichtigen, bevor die \u00c4nderung in Kraft tritt. Wir empfehlen Ihnen, diese Seite regelm\u00e4\u00dfig auf die neuesten Informationen zu unseren Datenschutzpraktiken zu \u00fcberpr\u00fcfen. Wenn Sie die Dienste nach Inkrafttreten dieser \u00c4nderungen weiterhin nutzen, stimmen Sie der \u00fcberarbeiteten Richtlinie zu.", "privacy", "de");
t.add("statement_changes.header", "\u00c4nderungen an dieser Erkl\u00e4rung", "privacy", "de");
t.add("web_tech_terms.1", "AwardWallet verbessert unsere Webseiten und Produkte kontinuierlich durch den Einsatz verschiedener Webanalysetools von Drittanbietern, die uns helfen zu verstehen, wie Besucher unsere Webseiten, Desktop-Tools und mobilen Anwendungen nutzen, was sie m\u00f6gen und was nicht und womit sie m\u00f6glicherweise Probleme haben.", "privacy", "de");
t.add("web_tech_terms.10", "Wir verwenden mobile Analysesoftware, um die Funktionalit\u00e4t unserer mobilen Software auf Ihrem Smartphone besser zu verstehen. Diese Software kann Informationen aufzeichnen, z. B. wie oft Sie die Anwendung verwenden, die Ereignisse, die innerhalb der Anwendung auftreten, aggregierte Nutzung, Leistungsdaten und woher die Anwendung heruntergeladen wurde. Wir verkn\u00fcpfen die Informationen, die wir in der Analysesoftware speichern, nicht mit personenbezogenen Daten, die Sie in der mobilen Anwendung \u00fcbermitteln.", "privacy", "de");
t.add("web_tech_terms.11", "Soziale Medien: Unsere Webseiten enthalten Funktionen f\u00fcr soziale Medien, z. B. den Beitritt zu unserer Gruppenseite auf Facebook. Diese Funktionen k\u00f6nnen Ihre IP-Adresse erfassen, welche Seite Sie auf unserer Website besuchen und m\u00f6glicherweise ein Cookie setzen, damit die Funktion ordnungsgem\u00e4\u00df funktioniert. Diese Dienste authentifizieren auch Ihre Identit\u00e4t und bieten Ihnen die M\u00f6glichkeit, bestimmte personenbezogene Daten wie Ihren Namen und Ihre E-Mail-Adresse mit uns zu teilen, um unser Anmeldeformular vorab auszuf\u00fcllen oder Feedback zu geben. Ihre Interaktionen mit diesen Funktionen unterliegen der Datenschutzrichtlinie des Unternehmens, das sie bereitstellt.", "privacy", "de");
t.add("web_tech_terms.2", "Geolokalisierung und andere Daten:", "privacy", "de");
t.add("web_tech_terms.3", "Wir k\u00f6nnen genaue Geolokalisierungsdaten verwenden, jedoch nur, wenn Sie der Erfassung dieser Daten in Verbindung mit einem bestimmten Dienst ausdr\u00fccklich zustimmen. Wir verwenden auch Informationen wie IP-Adressen, um die allgemeinen geografischen Standorte unserer Besucher zu bestimmen. Die Web-Beacons, die in Verbindung mit diesen Webanalyse-Tools verwendet werden, k\u00f6nnen Daten sammeln, z. B. welchen Browser oder welches Betriebssystem eine Person verwendet, sowie Domainnamen, MIME-Typen und welche Inhalte, Produkte und Dienstleistungen beim Besuch einer unserer Webseiten oder bei der Registrierung f\u00fcr Dienstleistungen oder bei der Nutzung einer unserer mobilen Anwendungen angesehen oder heruntergeladen werden.", "privacy", "de");
t.add("web_tech_terms.4", "Google Analytics und Adobe Marketing Cloud:", "privacy", "de");
t.add("web_tech_terms.5", "Wir verwenden Google Analytics wie in %link_on%\u201cWie Google Daten verwendet, wenn Sie die Websites oder Apps unserer Partner nutzen.\"%link_off% beschrieben. Sie k\u00f6nnen verhindern, dass Ihre Daten von Google Analytics auf Websites verwendet werden, indem Sie %link2_on%hier%link2_off% das Browser-Add-On zur Deaktivierung von Google Analytics installieren. Wir verwenden auch IP-Adressmaskierung, eine Technik, mit der von %link3_on%Google Analytics%link3_off% erfasste IP-Adressen gek\u00fcrzt und in gek\u00fcrzter Form gespeichert werden, um eine R\u00fcckverfolgung auf einzelne Benutzer zu verhindern.", "privacy", "de");
t.add("web_tech_terms.6", "Tracking-Technologien:", "privacy", "de");
t.add("web_tech_terms.7", "AwardWallet und unsere Partner verwenden Cookies und \u00e4hnliche Tracking-Technologien, um Benutzerverkehrsmuster zu verfolgen und bestimmte Registrierungsinformationen zu speichern. Tracking-Technologien, die ebenfalls verwendet werden, sind Beacons, Tags und Skripte, um Informationen zu sammeln und zu verfolgen sowie um unseren Service zu verbessern und zu analysieren. Wenn Sie nicht m\u00f6chten, dass die von diesen Technologien gesammelten Informationen zum Zweck der Schaltung gezielter Anzeigen verwendet werden, k\u00f6nnen Sie dies in Ihrem Kontoprofil deaktivieren. Das Hilfemen\u00fc in der Men\u00fcleiste der meisten Browser informiert Sie dar\u00fcber, wie Sie Ihren Browser daran hindern, neue Cookies zu akzeptieren, wie Sie den Browser Sie benachrichtigen lassen, wenn Sie ein neues Cookie erhalten, und wie Sie Cookies insgesamt deaktivieren. Sie k\u00f6nnen die Website weiterhin aufrufen, wenn Sie Ihren Browser so einstellen, dass alle Cookies abgelehnt werden. Sie m\u00fcssen jedoch Cookies aktivieren, um ein Konto einzurichten und die Dienste zu installieren.", "privacy", "de");
